import CvHeader from "./00_header/CvHeader";
import CvAbout from "./01_about/CvAbout";
import CvTechstack from "./01_about/CvTechstack";

const CvRender = () => {
  return (
    <>
      <CvHeader />
      <CvAbout />
      <CvTechstack />
    </>
  );
};

export default CvRender;
